description:
Communes du littoral charentais où s’applique la loi du 3 janvier 1986 , dont l'objectif est de :
- maîtriser le processus de l'urbanisation en favorisant son développement en continuité de l'urbanisation existante, sa portée étant de plus en plus stricte au fur et à mesure que l'on s’approche du rivage ;
- préserver les espaces littoraux fragiles de toute urbanisation ou de toute utilisation qui constituerait une menace.

Pour les PPR naturels, le code de l'environnement définit deux catégories de zones (L562-1) : les zones exposées aux risques et les zones qui ne sont pas directement exposées aux risques mais sur lesquelles des mesures peuvent être prévues pour éviter d'aggraver le risque.
En fonction du niveau d'aléa, chaque zone fait l'objet d'un règlement opposable. Les règlements distinguent généralement trois types de zones :
1- les « zones d'interdiction de construire », dites « zones rouges », lorsque le niveau d'aléa est fort et que la règle générale est l'interdiction de construire ;
2- les « zones soumises à prescriptions », dites « zones bleues », lorsque le niveau d'aléa est moyen et que les projets sont soumis à des prescriptions adaptées au type d'enjeu ;
3- les zones non directement exposées aux risques mais où des constructions, des ouvrages, des aménagements ou des exploitations agricoles, forestières, artisanales, commerciales ou industrielles pourraient aggraver des risques ou en provoquer de nouveaux, soumises à interdictions ou prescriptions (cf. article L562-1 du Code de l'environnement) . Cette dernière catégorie ne s'applique qu'aux PPR naturels.

Cette couche permet à la direction de la voirie, de suivre la maintenance de la signalisation routière horizontale (ou marquages au sol).  
Seuls les marquages permanents sont saisis (pas les marquages ponctuels). Un marquage est considéré comme permanent dès lors que celui-ci ne nécessitera aucune intervention dans les 4 années suivant sa réalisation. Les marquages pour travaux ne sont pas saisis.  
Parmi les attributs disponibles :  
\- annee_realisation => année du dernier marquage ;  
\- etape => étape dans le cycle  
Valeurs possibles :  
>>> recharg1 : 1er rechargement en peinture ;  
>>> recharg2 : 2ème rechargement en peinture ;  
>>> reno_secu : marquage de sécurité (passages piéton, stop, pistes cyclables) ;  
>>> reno_tot : rénovation totale ;  
>>> neuf : marquage sur voie nouvelle.  
\- materiau => matériau de marquage  
Valeurs possibles :  
>>> Enduit   
>>> Peinture   
>>> Bande thermocollée  
\- type_prestataire => type de prestataire ;  
Valeurs possibles :  
>>> Régie   
>>> Entreprise  
\- ref_fournisseur => référence du fournisseur du produit utilisé ;  
\- commentaire => commentaire utile.  
A terme, cette couche sera complétée d'une information permettant de connaître le cycle de renouvellement des marquages qui dépend à la fois de la hiérarchisation du tronçon concerné ainsi et de sa situation dans/hors agglomération.

Les plans de prévention des risques naturels ont été institués par la loi du 2 février 1995 relative au renforcement de la protection de l'environnement. Ils constituent l'instrument essentiel de l'Etat en matière de prévention des risques. Leur objectif est le contrôle du développement de l'urbanisme et de l'occupation des sols dans les zones exposées à un risque.
Pour les PPR naturels, le code de l'environnement définit deux catégories de zones (L562-1) : les zones exposées aux risques et les zones qui ne sont pas directement exposées aux risques mais sur lesquelles des mesures peuvent être prévues pour éviter d'aggraver le risque.
